Україна запроваджує низку обмежень у прикордонних районах, які межують з РФ, Білоруссю та ОРДЛО

Що буде заборонено:

▪️ перебування у прикордонні у нічний час
▪️ вихід будь-яких плавзасобів з пунктів базування
▪️ рух транспорту (окрім військового, силових структур, агро-техніки) дорогами, що відсутні в реєстрі автомобільних доріг та ведуть до державного кордону;
▪️ перебування іноземців у прикордонній смузі, використання радіостанцій, польотів легкомоторних та безпілотних літальних апаратів;
▪️ відео-, кіно-, фотознімання особового складу й об’єктів Держприкордонслужби України;
▪️ пересування по берегу чи льоду прикордонних водойм

